import React from "react";


class Menu extends React.Component{
    constructor (props){
        super(props);
        this.state= {
            bandera: props.value
        }
    }
    render() {
        return(
            <div>
                {this.props.value ? 'true' : 'false'}
            </div>
        )
    }
}

export default Menu;
